import React from "react";
function FeedbackItem({item}){
    return(
        <div className="card">
        <div className="card-header position-absolute top-0 start-100 translate-middile badge rounded-pill bg-pink ">11</div>
        <div className="card-body">{item.text}</div>
            
        </div>
    )
}
export default FeedbackItem;
